#include<stdio.h>
#include<math.h>
#include<vector>
using namespace std;

float mean_absolute_deviation(vector<float> numbers){
    // Calculate the mean of the dataset
    float sum = 0.0;
    for (float num : numbers) {
        sum += num;
    }
    float mean = sum / numbers.size();

    // Calculate the sum of absolute deviations
    float absDevSum = 0.0;
    for (float num : numbers) {
        absDevSum += abs(num - mean);
    }

    // Calculate and return the Mean Absolute Deviation
    return absDevSum / numbers.size();
}

