#include<stdio.h>
#include<vector>
#include<string>
using namespace std;

vector<string> separate_paren_groups(string paren_string) {
    vector<string> result;
    string current_group;
    int balance = 0;

    for (char ch : paren_string) {
        if (ch == ' ') continue; // Ignore spaces

        current_group += ch;
        if (ch == '(') {
            balance++;
        } else if (ch == ')') {
            balance--;
        }

        if (balance == 0) {
            result.push_back(current_group);
            current_group.clear();
        }
    }

    return result;
}

