#include <bitset>
#include <functional>
#include <cmath>
#include <cstdlib>
#include <queue>
#include <bits/stdc++.h>

#include<stdio.h>
#include<string>
using namespace std;

bool is_palindrome(string str){
    // Test if given string is a palindrome 
    string s(str.rbegin(), str.rend());
    return s == str;
}

string make_palindrome(string str){
    /*
    Find the shortest palindrome that begins with a supplied string. 
    Algorithm idea is simple: 
    - Find the longest postfix of supplied string that is a palindrome. 
    - Append to the end of the string reverse of a string prefix that comes before the palindromic suffix.
    */
    if (str.empty()) return "";

    // Find the longest palindromic suffix
    int n = str.size();
    for (int i = 0; i < n; ++i) {
        if (is_palindrome(str.substr(i))) {
            // Append the reverse of the prefix to the end of the string
            string prefix = str.substr(0, i);
            reverse(prefix.begin(), prefix.end());
            return str + prefix;
        }
    }

    // If no palindromic suffix is found, append the reverse of the entire string
    string reversed = str;
    reverse(reversed.begin(), reversed.end());
    return str + reversed.substr(1);
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (make_palindrome("") == "");
    assert (make_palindrome("x") == "x");
     assert (make_palindrome("xyz") == "xyzyx");
     assert (make_palindrome("xyx") == "xyx") ;
     assert (make_palindrome("jerry") == "jerryrrej");
}

