vector<float> rescale_to_unit(vector<float> numbers){
    if (numbers.size() < 2) {
        throw invalid_argument("Vector must contain at least two elements.");
    }

    float minVal = numbers[0];
    float maxVal = numbers[0];

    // Find the minimum and maximum values in the vector
    for (float num : numbers) {
        if (num < minVal) {
            minVal = num;
        }
        if (num > maxVal) {
            maxVal = num;
        }
    }

    // Calculate the range
    float range = maxVal - minVal;

    // Apply the linear transform
    vector<float> rescaledNumbers;
    for (float num : numbers) {
        float rescaledNum = (num - minVal) / range;
        rescaledNumbers.push_back(rescaledNum);
    }

    return rescaledNumbers;
}

