#include<stdio.h>
#include<math.h>
#include<vector>
using namespace std;

vector<float> find_closest_elements(vector<float> numbers) {
    if (numbers.size() < 2) {
        throw invalid_argument("The input vector must contain at least two elements.");
    }

    vector<float> closestPair = {numbers[0], numbers[1]};
    float minDistance = abs(numbers[0] - numbers[1]);

    for (size_t i = 0; i < numbers.size(); ++i) {
        for (size_t j = i + 1; j < numbers.size(); ++j) {
            float distance = abs(numbers[i] - numbers[j]);
            if (distance < minDistance) {
                minDistance = distance;
                closestPair = {numbers[i], numbers[j]};
            }
        }
    }

    if (closestPair[0] > closestPair[1]) {
        swap(closestPair[0], closestPair[1]);
    }

    return closestPair;
}

