string sort_numbers(string numbers){
    // Map to convert words to their corresponding numbers
    map<string, int> wordToNumber = {
        {"zero", 0}, {"one", 1}, {"two", 2}, {"three", 3}, {"four", 4},
        {"five", 5}, {"six", 6}, {"seven", 7}, {"eight", 8}, {"nine", 9}
    };

    // Vector to store the numbers corresponding to the words
    vector<int> nums;

    // Stringstream to split the input string by spaces
    stringstream ss(numbers);
    string word;
    while (ss >> word) {
        nums.push_back(wordToNumber[word]);
    }

    // Sort the numbers
    sort(nums.begin(), nums.end());

    // Map to convert numbers back to their corresponding words
    map<int, string> numberToWord = {
        {0, "zero"}, {1, "one"}, {2, "two"}, {3, "three"}, {4, "four"},
        {5, "five"}, {6, "six"}, {7, "seven"}, {8, "eight"}, {9, "nine"}
    };

    // Stringstream to build the output string
    stringstream sortedNumbers;
    for (int i = 0; i < nums.size(); ++i) {
        if (i != 0) sortedNumbers << " ";
        sortedNumbers << numberToWord[nums[i]];
    }

    return sortedNumbers.str();
}

