float max_element(vector<float> l){
    if (l.empty()) {
        throw invalid_argument("Vector is empty");
    }
    float maxVal = l[0];
    for (float num : l) {
        if (num > maxVal) {
            maxVal = num;
        }
    }
    return maxVal;
}

