using namespace std;

vector<int> sort_third(vector<int> l) {
    vector<int> l_prime = l; // Initialize l' with the same values as l
    vector<int> to_sort; // Vector to store elements at indices divisible by three

    // Collect elements at indices divisible by three
    for (int i = 0; i < l.size(); i += 3) {
        to_sort.push_back(l[i]);
    }

    // Sort the collected elements
    sort(to_sort.begin(), to_sort.end());

    // Replace the elements in l' with the sorted elements
    int index = 0;
    for (int i = 0; i < l.size(); i += 3) {
        l_prime[i] = to_sort[index++];
    }

    return l_prime;
}

