#include <stdlib.h>
#include <algorithm>
#include <math.h>
#include <vector>
#include <climits>
#include <cstring>
#include <iostream>
#include <cassert>
#include <bitset>
#include <functional>
#include <cmath>
#include <cstdlib>
#include <queue>
#include <bits/stdc++.h>

#include <stdio.h>
#include <string>

using namespace std;

int countSevens(int num) {
    int count = 0;
    while (num > 0) {
        if (num % 10 == 7) {
            count++;
        }
        num /= 10;
    }
    return count;
}

int fizz_buzz(int n) {
    int count = 0;
    for (int i = 1; i < n; ++i) {
        if (i % 11 == 0 || i % 13 == 0) {
            count += countSevens(i);
        }
    }
    return count;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (fizz_buzz(50) == 0);
    assert (fizz_buzz(78) == 2);
    assert (fizz_buzz(79) == 3);
    assert (fizz_buzz(100) == 3);
    assert (fizz_buzz(200) == 6);
    assert (fizz_buzz(4000) == 192);
    assert (fizz_buzz(10000) == 639);
    assert (fizz_buzz(100000) == 8026);
}

