using namespace std;

vector<int> unique(vector<int> l){
    // Sort the vector to bring duplicates together
    sort(l.begin(), l.end());

    // Use a vector to store unique elements
    vector<int> uniqueElements;

    // Iterate through the sorted vector
    for (size_t i = 0; i < l.size(); ++i) {
        // If the current element is different from the previous one, add it to the uniqueElements vector
        if (i == 0 || l[i] != l[i - 1]) {
            uniqueElements.push_back(l[i]);
        }
    }

    return uniqueElements;
}

