vector<float> sort_even(vector<float> l) {
    vector<float> l_prime = l; // Initialize l' with the same values as l
    vector<float> even_values; // To store the values at even indices

    // Extract values at even indices
    for (size_t i = 0; i < l.size(); i += 2) {
        even_values.push_back(l[i]);
    }

    // Sort the extracted values
    sort(even_values.begin(), even_values.end());

    // Replace the even indices in l' with the sorted values
    for (size_t i = 0, j = 0; i < l.size(); i += 2, ++j) {
        l_prime[i] = even_values[j];
    }

    return l_prime;
}

#undef NDEBUG
#include<assert.h>
bool issame(vector<float> a,vector<float>b){
    if (a.size()!=b.size()) return false;
    for (int i=0;i<a.size();i++)
    {
        if (abs(a[i]-b[i])>1e-4) return false;
    }
    return true;
}
int main(){
    assert (issame(sort_even({1, 2, 3}), {1, 2, 3}));
    assert (issame(sort_even({5, 3, -5, 2, -3, 3, 9, 0, 123, 1, -10}) , {-10, 3, -5, 2, -3, 3, 5, 0, 9, 1, 123}));
    assert (issame(sort_even({5, 8, -12, 4, 23, 2, 3, 11, 12, -10}) , {-12, 8, 3, 4, 5, 2, 12, 11, 23, -10}));
}

