#include<algorithm>
using namespace std;

float median(vector<float> l){
    // Sort the vector
    sort(l.begin(), l.end());

    // Find the size of the vector
    int n = l.size();

    // If the size is odd, return the middle element
    if (n % 2 != 0) {
        return l[n / 2];
    }
    // If the size is even, return the average of the two middle elements
    else {
        return (l[n / 2 - 1] + l[n / 2]) / 2.0;
    }
}

