#include<stdio.h>
#include<vector>
using namespace std;

bool monotonic(vector<float> l){
    if (l.size() < 2) return true; // A single element or no elements are trivially monotonic

    bool increasing = true;
    bool decreasing = true;

    for (size_t i = 1; i < l.size(); ++i) {
        if (l[i] > l[i - 1]) {
            decreasing = false;
        } else if (l[i] < l[i - 1]) {
            increasing = false;
        }

        // If neither increasing nor decreasing, it's not monotonic
        if (!increasing && !decreasing) {
            return false;
        }
    }

    return true;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (monotonic({1, 2, 4, 10}) == true);
    assert (monotonic({1, 2, 4, 20}) == true);
    assert (monotonic({1, 20, 4, 10}) == false);
    assert (monotonic({4, 1, 0, -10}) == true);
    assert (monotonic({4, 1, 1, 0}) == true);
    assert (monotonic({1, 2, 3, 2, 5, 60}) == false);
    assert (monotonic({1, 2, 3, 4, 5, 60}) == true);
    assert (monotonic({9, 9, 9, 9}) == true);
}

