#include<unordered_set>
using namespace std;

vector<int> common(vector<int> l1, vector<int> l2) {
    // Convert the first list to a set for O(1) average time complexity lookups
    unordered_set<int> set1(l1.begin(), l1.end());

    // Use a set to store common elements to ensure uniqueness
    unordered_set<int> commonSet;

    // Iterate through the second list and check for common elements
    for (int num : l2) {
        if (set1.find(num) != set1.end()) {
            commonSet.insert(num);
        }
    }

    // Convert the set of common elements to a vector and sort it
    vector<int> result(commonSet.begin(), commonSet.end());
    sort(result.begin(), result.end());

    return result;
}

