#include <queue>
#include <bits/stdc++.h>

#include<stdio.h>
#include<string>
using namespace std;

string circular_shift(int x, int shift) {
    // Convert the integer to a string to easily manipulate its digits
    string digits = to_string(x);
    int num_digits = digits.size();

    // If shift is greater than the number of digits, return the digits reversed
    if (shift > num_digits) {
        reverse(digits.begin(), digits.end());
        return digits;
    }

    // Calculate the effective shift (modulo the number of digits)
    shift = shift % num_digits;

    // Perform the circular shift
    string result = digits.substr(num_digits - shift) + digits.substr(0, num_digits - shift);

    return result;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (circular_shift(100, 2) == "001");
    assert (circular_shift(12, 2) == "12");
    assert (circular_shift(97, 8) == "79");
    assert (circular_shift(12, 1) == "21");
    assert (circular_shift(11, 101) == "11");
}

