#include<algorithm>
using namespace std;

int vowels_count(string s) {
    int count = 0;
    transform(s.begin(), s.end(), s.begin(), ::tolower); // Convert string to lowercase
    for (char c : s) {
        if (c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u') {
            count++;
        }
    }
    // Check if 'y' is at the end of the word
    if (s.back() == 'y') {
        count++;
    }
    return count;
}

#undef NDEBUG
#include<assert.h>
