#include <queue>
#include <bits/stdc++.h>

#include<stdio.h>
#include<vector>
using namespace std;

vector<int> pluck(vector<int> arr) {
    if (arr.empty()) return {};

    int smallestEven = -1;
    int smallestIndex = -1;

    for (int i = 0; i < arr.size(); ++i) {
        if (arr[i] % 2 == 0) {
            if (smallestEven == -1 || arr[i] < smallestEven) {
                smallestEven = arr[i];
                smallestIndex = i;
            }
        }
    }

    if (smallestEven == -1) return {};

    return {smallestEven, smallestIndex};
}

#undef NDEBUG
#include<assert.h>
bool issame(vector<int> a,vector<int>b){
    if (a.size()!=b.size()) return false;
    for (int i=0;i<a.size();i++)
    {
        if (a[i]!=b[i]) return false;
    }
    return true;
}
int main(){
    assert (issame(pluck({4,2,3}) , {2, 1}));
    assert (issame(pluck({1,2,3}) , {2, 1}));
    assert (issame(pluck({}) , {}));
    assert (issame(pluck({5, 0, 3, 0, 4, 2}) , {0, 1}));
    assert (issame(pluck({1, 2, 3, 0, 5, 3}) , {0, 3}));
    assert (issame(pluck({5, 4, 8, 4 ,8}) , {4, 1}));
    assert (issame(pluck({7, 6, 7, 1}) , {6, 1}));
    assert (issame(pluck({7, 9, 7, 1}) , {}));
}

