int fruit_distribution(string s, int n) {
    // Initialize variables to store the number of apples and oranges
    int apples = 0, oranges = 0;

    // Use a stringstream to parse the input string
    stringstream ss(s);
    string temp;
    vector<string> tokens;

    // Tokenize the input string
    while (ss >> temp) {
        tokens.push_back(temp);
    }

    // Extract the number of apples and oranges from the tokens
    for (int i = 0; i < tokens.size(); i++) {
        if (tokens[i] == "apples") {
            apples = stoi(tokens[i - 1]);
        } else if (tokens[i] == "oranges") {
            oranges = stoi(tokens[i - 1]);
        }
    }

    // Calculate the number of mangoes
    int mangoes = n - apples - oranges;

    return mangoes;
}

