#include<unordered_map>
#include<algorithm>
using namespace std;

int search(vector<int> lst){
    unordered_map<int, int> frequencyMap;

    // Count the frequency of each integer in the vector
    for(int num : lst){
        frequencyMap[num]++;
    }

    int result = -1;

    // Iterate through the frequency map to find the greatest integer that meets the criteria
    for(const auto& pair : frequencyMap){
        int num = pair.first;
        int freq = pair.second;

        if(num <= freq && num > result){
            result = num;
        }
    }

    return result;
}

