#include<algorithm>
using namespace std;

vector<int> strange_sort_list(vector<int> lst) {
    vector<int> result;
    sort(lst.begin(), lst.end());

    int i = 0;
    int j = lst.size() - 1;

    while (i <= j) {
        if (i <= j) {
            result.push_back(lst[i]);
            i++;
        }
        if (i <= j) {
            result.push_back(lst[j]);
            j--;
        }
    }

    return result;
}

