int starts_one_ends(int n) {
    // If n is 1, there are exactly two numbers: 1 and 0.
    if (n == 1) {
        return 2;
    }

    // For n > 1, the count of n-digit numbers that start or end with 1 is:
    // - Numbers that start with 1: 10^(n-1)
    // - Numbers that end with 1: 10^(n-1)
    // - Numbers that both start and end with 1: 10^(n-2)
