string anti_shuffle(string s) {
    string result;
    string word;
    bool in_word = false;

    for (char c : s) {
        if (c == ' ') {
            if (in_word) {
                sort(word.begin(), word.end());
                result += word;
                word.clear();
                in_word = false;
            }
            result += c;
        } else {
            word += c;
            in_word = true;
        }
    }

    if (!word.empty()) {
        sort(word.begin(), word.end());
        result += word;
    }

    return result;
}

