#include <queue>
#include <bits/stdc++.h>

#include<stdio.h>
#include<vector>
#include<algorithm>
using namespace std;

vector<vector<int>> get_row(vector<vector<int>> lst, int x) {
    vector<vector<int>> coordinates;

    // Iterate through each row
    for (int i = 0; i < lst.size(); ++i) {
        // Iterate through each column in the current row
        for (int j = 0; j < lst[i].size(); ++j) {
            // If the element matches x, add the coordinate to the list
            if (lst[i][j] == x) {
                coordinates.push_back({i, j});
            }
        }
    }

    // Sort coordinates by rows in ascending order
    sort(coordinates.begin(), coordinates.end(), [](const vector<int>& a, const vector<int>& b) {
        return a[0] < b[0];
    });

    // For each row, sort coordinates by columns in descending order
    int currentRow = -1;
    for (int i = 0; i < coordinates.size(); ++i) {
        if (coordinates[i][0] != currentRow) {
            currentRow = coordinates[i][0];
            int start = i;
            while (i + 1 < coordinates.size() && coordinates[i + 1][0] == currentRow) {
                ++i;
            }
            sort(coordinates.begin() + start, coordinates.begin() + i + 1, [](const vector<int>& a, const vector<int>& b) {
                return a[1] > b[1];
            });
        }
    }

    return coordinates;
}

