bool any_int(float a, float b, float c) {
    // Check if all numbers are integers
    if (floor(a) != a || floor(b) != b || floor(c) != c) {
        return false;
    }

    // Convert to integers
    int intA = static_cast<int>(a);
    int intB = static_cast<int>(b);
    int intC = static_cast<int>(c);

    // Check if one of the numbers is equal to the sum of the other two
    if (intA == intB + intC || intB == intA + intC || intC == intA + intB) {
        return true;
    }

    return false;
}

