bool check_dict_case(map<string, string> dict) {
    if (dict.empty()) {
        return false;
    }

    bool all_lower = true;
    bool all_upper = true;

    for (const auto& pair : dict) {
        const string& key = pair.first;

        if (key.empty()) {
            return false;
        }

        bool is_lower = true;
        bool is_upper = true;

        for (char c : key) {
            if (!islower(c)) {
                is_lower = false;
            }
            if (!isupper(c)) {
                is_upper = false;
            }
        }

        if (!is_lower && !is_upper) {
            return false;
        }

        all_lower &= is_lower;
        all_upper &= is_upper;
    }

    return all_lower || all_upper;
}

