int closest_integer(string value) {
    // Convert the string to a double
    double num = stod(value);

    // Check if the number is exactly halfway between two integers
    if (fmod(num, 1) == 0.5) {
        // If the number is positive, round up
        if (num > 0) {
            return static_cast<int>(num + 0.5);
        }
        // If the number is negative, round down
        else {
            return static_cast<int>(num - 0.5);
        }
    }
    // If the number is not halfway between two integers, round to the nearest integer
    else {
        return static_cast<int>(round(num));
    }
}

