vector<string> words_string(string s){
    vector<string> words;
    stringstream ss(s);
    string word;

    // Use a delimiter to split the string by both commas and spaces
    while (getline(ss, word, ',')) {
        // Remove leading and trailing spaces from the word
        word.erase(word.begin(), find_if(word.begin(), word.end(), [](int ch) {
            return !isspace(ch);
        }));
        word.erase(find_if(word.rbegin(), word.rend(), [](int ch) {
            return !isspace(ch);
        }).base(), word.end());

        // If the word is not empty, add it to the vector
        if (!word.empty()) {
            words.push_back(word);
        }
    }

    // If there are no commas, split by spaces
    if (words.empty()) {
        ss.clear();
        ss.str(s);
        while (ss >> word) {
            words.push_back(word);
        }
    }

    return words;
}

