#include<stdio.h>
#include<math.h>
#include<string>
using namespace std;

string rounded_avg(int n, int m) {
    if (n > m) {
        return "-1";
    }

    // Calculate the sum of integers from n to m
    int sum = 0;
    for (int i = n; i <= m; ++i) {
        sum += i;
    }

    // Calculate the average
    int count = m - n + 1;
    double average = static_cast<double>(sum) / count;

    // Round the average to the nearest integer (smaller one)
    int rounded_average = static_cast<int>(floor(average));

    // Convert the rounded average to binary
    string binary_representation;
    if (rounded_average == 0) {
        binary_representation = "0";
    } else {
        while (rounded_average > 0) {
            binary_representation = to_string(rounded_average % 2) + binary_representation;
            rounded_average /= 2;
        }
    }

    return binary_representation;
}

