    // Reverse the sorted array
    reverse(filteredArr.begin(), filteredArr.end());

    // Replace each digit by its corresponding name
    vector<string> result;
    for (int num : filteredArr) {
        result.push_back(digitToName[num]);
    }

    return result;
}

