bool move_one_ball(vector<int> arr) {
    if (arr.empty()) return true;

    int n = arr.size();
    int shifts = 0;

    // Find the number of shifts needed to make the array sorted
    for (int i = 0; i < n; ++i) {
        if (arr[i] > arr[(i + 1) % n]) {
            shifts++;
        }
    }

    // If more than one shift is needed, it's not possible to sort the array
    return shifts <= 1;
}

