    bool isPalindrome = true;
    int n = result.size();
    for (int i = 0; i < n / 2; ++i) {
        if (result[i] != result[n - i - 1]) {
            isPalindrome = false;
            break;
        }
    }

    // Return the result string and the palindrome check result
    return {result, isPalindrome ? "True" : "False"};
}

