#include<stdio.h>
#include<vector>
using namespace std;

int max_fill(vector<vector<int>> grid, int capacity) {
    int total_lowers = 0;

    for (const auto& well : grid) {
        int water_units = 0;
        for (const auto& unit : well) {
            if (unit == 1) {
                water_units++;
            }
        }
        total_lowers += (water_units + capacity - 1) / capacity; // Equivalent to ceil(water_units / capacity)
    }

    return total_lowers;
}

#undef NDEBUG
