int prod_signs(vector<int> arr) {
    if (arr.empty()) {
        return -32768;
    }

    int productOfSigns = 1;
    int sumOfMagnitudes = 0;

    for (int num : arr) {
        if (num > 0) {
            productOfSigns *= 1;
        } else if (num < 0) {
            productOfSigns *= -1;
        } else {
            productOfSigns *= 0;
        }
        sumOfMagnitudes += abs(num);
    }

    return sumOfMagnitudes * productOfSigns;
}

