vector<int> tri(int n) {
    vector<int> tribonacciSequence;
    if (n < 0) return tribonacciSequence; // Handle invalid input

    // Initialize the first element of the sequence
    tribonacciSequence.push_back(1);

    // Handle the case where n is 0
    if (n == 0) return tribonacciSequence;

    // Initialize the second element of the sequence
    tribonacciSequence.push_back(3);

    // Handle the case where n is 1
    if (n == 1) return tribonacciSequence;

    // Initialize the third element of the sequence
    tribonacciSequence.push_back(2);

    // Handle the case where n is 2
    if (n == 2) return tribonacciSequence;

    // Compute the rest of the sequence
    for (int i = 3; i <= n; ++i) {
        int nextValue;
        if (i % 2 == 0) {
            nextValue = 1 + i / 2;
        } else {
            nextValue = tribonacciSequence[i - 1] + tribonacciSequence[i - 2] + tribonacciSequence[i + 1];
        }
        tribonacciSequence.push_back(nextValue);
    }

    return tribonacciSequence;
}

