    int N = grid.size();
    vector<vector<int>> directions = {{0, 1}, {1, 0}, {0, -1}, {-1, 0}};
    vector<int> result;

    // Helper function to perform DFS and find the minimum path
    function<void(int, int, vector<int>&)> dfs = [&](int x, int y, vector<int>& path) {
