            int nx = x + dir[0];
            int ny = y + dir[1];
            if (nx >= 0 && nx < N && ny >= 0 && ny < N) {
                path.push_back(grid[nx][ny]);
                dfs(nx, ny, path);
                path.pop_back();
            }
        }
    };

    // Start DFS from each cell in the grid
    for (int i = 0; i < N; ++i) {
        for (int j = 0; j < N; ++j) {
            vector<int> path = {grid[i][j]};
            dfs(i, j, path);
        }
    }

    return result;
}

