vector<int> minPath(vector<vector<int>> grid, int k) {
    int N = grid.size();
    vector<vector<int>> directions = {{0, 1}, {1, 0}, {0, -1}, {-1, 0}};
    vector<int> result;
    priority_queue<vector<int>, vector<vector<int>>, greater<vector<int>>> pq;

    // Initialize the priority queue with all starting points
    for (int i = 0; i < N; ++i) {
        for (int j = 0; j < N; ++j) {
            pq.push({grid[i][j], i, j, 0});
        }
    }

    while (!pq.empty()) {
        auto current = pq.top();
        pq.pop();
        int value = current[0];
        int x = current[1];
        int y = current[2];
        int steps = current[3];

        if (steps == k - 1) {
            result.push_back(value);
            break;
        }

        for (auto& dir : directions) {
            int newX = x + dir[0];
            int newY = y + dir[1];
            if (newX >= 0 && newX < N && newY >= 0 && newY < N) {
                pq.push({grid[newX][newY], newX, newY, steps + 1});
            }
        }
    }

    return result;
}

