#include<stdio.h>
#include<string>
using namespace std;

string fix_spaces(string text){
    string result = "";
    int spaceCount = 0;

    for (char c : text) {
        if (c == ' ') {
            spaceCount++;
            if (spaceCount == 1) {
                result += '_';
            } else if (spaceCount > 2) {
                // Do nothing, we will replace multiple spaces with '-' later
            }
        } else {
            if (spaceCount > 2) {
                result += '-';
            }
            spaceCount = 0;
            result += c;
        }
    }

    // Handle the case where the string ends with multiple spaces
    if (spaceCount > 2) {
        result += '-';
    }

    return result;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (fix_spaces("Example") == "Example");
    assert (fix_spaces("Mudasir Hanif ") == "Mudasir_Hanif_");
    assert (fix_spaces("Yellow Yellow  Dirty  Fellow") == "Yellow_Yellow__Dirty__Fellow");
    assert (fix_spaces("Exa   mple") == "Exa-mple");
    assert (fix_spaces("   Exa 1 2 2 mple") == "-Exa_1_2_2_mple");
}

