string fix_spaces(string text) {
    string result;
    int spaceCount = 0;

    for (char c : text) {
        if (c == ' ') {
            spaceCount++;
        } else {
            if (spaceCount > 0) {
                if (spaceCount == 1) {
                    result += '_';
                } else {
                    result += '-';
                }
                spaceCount = 0;
            }
            result += c;
        }
    }

    // Handle trailing spaces
    if (spaceCount == 1) {
        result += '_';
    } else if (spaceCount > 1) {
        result += '-';
    }

    return result;
}

