vector<string> bf(string planet1, string planet2) {
    // List of planets in order of their proximity to the Sun
    vector<string> planets = {"Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"};

    // Find the indices of the given planets
    int index1 = -1, index2 = -1;
    for (int i = 0; i < planets.size(); i++) {
        if (planets[i] == planet1) index1 = i;
        if (planets[i] == planet2) index2 = i;
    }

    // If either planet is not found, return an empty vector
    if (index1 == -1 || index2 == -1) return {};

    // Ensure index1 is less than index2
    if (index1 > index2) swap(index1, index2);

    // Collect the planets between index1 and index2 (exclusive)
    vector<string> result;
    for (int i = index1 + 1; i < index2; i++) {
        result.push_back(planets[i]);
    }

    return result;
}

