#include<string>
#include<vector>
using namespace std;

vector<int> even_odd_count(int num) {
    vector<int> result = {0, 0}; // Initialize result vector with {even_count, odd_count}
    num = abs(num); // Handle negative numbers

    while (num > 0) {
        int digit = num % 10; // Get the last digit
        if (digit % 2 == 0) {
            result[0]++; // Increment even count
        } else {
            result[1]++; // Increment odd count
        }
        num /= 10; // Remove the last digit
    }

    return result;
}

