bool right_angle_triangle(float a, float b, float c) {
    // Ensure the sides are sorted in ascending order
    float sides[3] = {a, b, c};
    for (int i = 0; i < 2; i++) {
        for (int j = i + 1; j < 3; j++) {
            if (sides[i] > sides[j]) {
                float temp = sides[i];
                sides[i] = sides[j];
                sides[j] = temp;
            }
        }
    }

    // Check the Pythagorean theorem
    return (pow(sides[0], 2) + pow(sides[1], 2) == pow(sides[2], 2));
}

