string find_max(vector<string> words){
    auto count_unique_chars = [](const string& word) {
        unordered_set<char> unique_chars(word.begin(), word.end());
        return unique_chars.size();
    };

    string max_word = "";
    int max_unique_count = 0;

    for (const string& word : words) {
        int unique_count = count_unique_chars(word);
        if (unique_count > max_unique_count || (unique_count == max_unique_count && word < max_word)) {
            max_word = word;
            max_unique_count = unique_count;
        }
    }

    return max_word;
}

